import './App.css';
import React from 'react'
import axios from 'axios'

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      rating: 0,
      name: ''
    };
  }
  arrayList = (data) => {
    let arrayList = Object.values(data)

    this.setState({ name: this.state.name = arrayList[1] })
    console.log(arrayList[1])
    //return arrayList
  }

  render() {
   const getData = axios.get('http://localhost:4000/')
      .then(function (response) {

        //arrayList(response.data)
        //return response.data
        //console.log(response.data.name)
        this.setState({name: response.data.name})
      })
      .catch(function (error) {

        console.log(error);
      })
    return (

      <div>
        <div className="App">
          <h1>{this.state.name}</h1>
          <button type = "button" onClick={this.getData}>test</button>
        </div>
      </div>

    );
  }
}

export default App;
